import React, {Component} from 'react'
import {withCharacter} from './MyProvider'

class SingleSpell extends Component {
    componentDidMount(){
        this.props.getOneSpell(this.props.match.params.id)
    }

    render(){
        const {spell, type, effect} = this.props.spell
        return(
            <div>SSpell
                <h2>{spell}</h2>
                <h4>{type}</h4>
                <h5>{effect}</h5>
            </div>
        )
    }
}

export default withCharacter(SingleSpell)
